import './App.css';
import LoginLayout from './components/LoginLayout';
import { Switch, Route } from 'react-router-dom';

const App=()=> {
  return (
    <div className="App">
    <Switch>
   <Route path='/login'  render={props => <LoginLayout/>}/>
   </Switch>
    </div>
  );
}

export default App;
